import { Button, Container, Form } from "semantic-ui-react";
// import { useForm } from "../../../hooks/useForm";
import { useForm } from "react-hook-form";

export type SignUpFormValues = {
    username?: string;
    email?: string,
    password?: string;
}

type LoginProps = {
    onSuccess: (formValues: SignUpFormValues) => void;
    onError?: (errors: any) => void;
}

export default function SignUp({ onSuccess, onError }: LoginProps) {

    const { handleSubmit, register } = useForm<SignUpFormValues>();

    return (
        <Form {...formProps}>
            <Form.Field>
                <label>Username</label>
                <input {...getFieldProps("username")} name="username" placeholder="Username" />
            </Form.Field>
            <Form.Field>
                <label>Email</label>
                <input {...getFieldProps("email")} name="email" placeholder="Email" />
            </Form.Field>
            <Form.Field>
                <label>Password</label>
                <input {...getFieldProps("password")} type="password" name="password" placeholder="Password" />
            </Form.Field>
            <Form.Field>
                <label>Confirm Password</label>
                <input {...getFieldProps("confirmPassword")} type="password" name="confirmPassword" placeholder="Confirm Password" />
            </Form.Field>
            <Button type="submit">
                Log In
            </Button>
        </Form>
    );
}
